const Navbar = () => {
  return (
    <div className="p-0 m-0 d-flex row  justify-content-center align-items-center ">
      <div className="p-0 m-0 d-flex flex-row justify-content-between align-items-center">
        <h4 className="p-0 m-0 col-md-6 bg-dark">Bonte Takaway</h4>

        <ul className="p-2 m-0 d-flex flex-row">
          <li>Home</li>
          <li>About us</li>
          <li>Contact us</li>
        </ul>
      </div>
    </div>
  );
};

export default Navbar;
